// importer le fichier react 
import React from 'react';

const Membre = () => {
    const nom = {Soufian , Sami , Fouz , Antho, Oliver}
    return (
        <fragment>
        <h2>Liste des membres :</h2>
        <div>
            <ul>
                <li> {nom}</li>
            </ul>
        </div>
        </fragment>
    )
} 

export default Membre
